const styles = (theme) => ({
  summaryTitleContainer: {
    marginBottom: theme.spacing(1),
  },
  summaryTitle: {
    fontSize: theme.typography.pxToRem(18),
    fontWeight: theme.typography.fontWeightMedium,
  },
});

export default styles;
